      "<div><div><b>Maria Andreou (9:06 A.M.)</b> Good morning, Jakob and Sandra. I need help with the focus group with the photographers that is taking place on Thursday morning. I'm no longer available to lead it.</div><div><b>Jakob Wendt (9:09 A.M.)</b> That's unfortunate. We need to follow up with that meeting to advise our client about what is important to potential customers.</div><div><b>Maria Andreou (9:10 A.M.)</b> Exactly. So I would rather not have to reschedule. The client is expecting our report early next week. Would either of you be able to conduct the group instead of me?</div><div><b>Sandra Liu (9:12 A.M.)</b> Sorry, Maria. I'm traveling out of town tomorrow for the marketing conference, and won't be back until Friday.</div><div><b>Jakob Wendt (9:15 A.M.)</b> I've never led a focus group before, but I'm happy to do it.</div><div><b>Maria Andreou (9:17 A.M.)</b> Great. I'll send you the participant consent form by e-mail. Remember that at the start of the group session, each participant will need to sign a copy.</div><div><b>Jakob Wendt (9:18 A.M.)</b> OK. How many copies will be needed?</div><div><b>Sandra Liu (9:19 A.M.)</b> Actually, there's no need. I have copies left over from another group ran last Tuesday. They're still on my desk.</div><div><b>Jakob Wendt (9:20 A.M.)</b> I'll stop by and pick them up later today.</div><div><b>Maria Andreou (9:21 A.M)</b> Thank you both. This means we can meet and work on the advertising report for the client next Monday.</div><div><br/></div> <hr/></div>",
    transcript:
      "<div><p><b>Maria Andreou (9:06 </b><b>A.M</b><b>)</b> Chào buổi sáng, Jakob và Sandra. Tôi cần trợ giúp về nhóm tập trung với các nhiếp ảnh gia diễn ra vào sáng thứ Năm. Tôi không còn rảnh để điều hành nó nữa.</p><p><b>Jakob Wendt (9:09 </b><b>A.M</b><b>)</b> Thật không may. Chúng ta cần theo dõi cuộc họp đó để tư vấn cho khách hàng của chúng ta về điều gì là quan trọng đối với khách hàng tiềm năng.</p><p><b>Maria Andreou (9:10 A.M.)</b> Chính xác. Vì vậy, tôi không muốn phải đổi lịch. Khách hàng đang mong đợi báo cáo của chúng ta vào đầu tuần tới. Liệu ai trong số các bạn có thể điều hành nhóm thay vì tôi?</p><p><b>Sandra Liu (9:12 </b><b>A.M</b><b>)</b> Xin lỗi, Maria. Ngày mai tôi sẽ đi ra khỏi thị trấn cho hội nghị tiếp thị và sẽ không trở lại cho đến thứ Sáu.</p><p><b>Jakob Wendt (9:15 </b><b>A.M</b><b>)</b> Tôi chưa bao giờ điều hành một nhóm tập trung trước đây, nhưng tôi rất vui khi làm điều đó.</p><p><b>Maria Andreou (9:17 A.M.)</b> Tuyệt vời. Tôi sẽ gửi cho bạn biểu mẫu chấp thuận của người tham gia qua e-mail. Hãy nhớ rằng khi bắt đầu phiên họp nhóm, mỗi người tham gia sẽ cần phải ký vào một bản.</p><p><b>Jakob Wendt (9:18 </b><b>A.M</b><b>)</b> OK. Cần bao nhiêu bản?</p><p><b>Sandra Liu (9:19 </b><b>A.M</b><b>)</b> Thực ra thì không cần đâu. Tôi còn lại các bản từ một nhóm khác đã diễn ra vào thứ Ba tuần trước. Chúng vẫn còn trên bàn của tôi.</p><p><b>Jakob Wendt (9:20 </b><b>A.M</b><b>) </b>Tôi sẽ ghé lại và lấy chúng lúc muộn ngày hôm nay.</p><p><b>Maria Andreou (9:21 A.M) </b>Cảm ơn cả hai. Điều này có nghĩa là chúng ta có thể gặp và làm việc về báo cáo quảng cáo cho khách hàng vào thứ Hai tới.</p><hr/></div>",
