    detail:
      '<div><div><table class="table table-bordered"><tbody><tr><td>Our Company<br/></td><td><b>Our Products</b><br/></td><td>Our Partners <br/></td><td>Contact Us<br/></td></tr></tbody></table></div><div>Drymotic is pleased to announce that our revolutionary vacuum-microwave dehydration process is now being used by more than 30 companies in the food and pharmaceutical industries.</div><div>Here\'s how it works: Batches of raw organic materials, prepared in small pieces, are loaded into the machine\'s rotating drum. As the drum turns, moisture is removed from the pieces by microwave energy. The final moisture level can be preset by the operator. The dried pieces <b><i>retain</i></b> their color, taste, and nutrition, and are then ready for packaging. Drymotic machines produce better results in less time (and at lower cost) than freeze-drying and air-drying.</div><div>Drymotic machines are available in the following sizes:</div><table class="table table-bordered"><tbody><tr><td><b>Model Number</b></td><td><b>Power</b></td><td><b>Suggested use</b></td></tr><tr><td>G4200</td><td>10 kw</td><td>Testing new products</td></tr><tr><td>G4260</td><td>50 kw</td><td>Small-scale manufactures</td></tr><tr><td>H4500</td><td>100 kw</td><td>Large-scale, high-volume manufactures</td></tr></tbody></table><div><br/></div><div><br/></div> <hr/><p><b>*E-mail*</b></p><p><b>To:</b> <a class="__cf_email__" data-cfemail="0e6d7b7d7a61636b7c7d6b7c78676d6b4e6a7c7763617a676d206d6163" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>From:</b> <a class="__cf_email__" data-cfemail="177861787b6372656576576e767a75657263633974787a397662" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>Date:</b> 6 May</p><p><b>Subject: </b>Malfunctioning unit</p><p>Dear Customer Service,</p><p>We purchased a Drymotic unit (product number: G4260, serial number: 01938207) last year for use with our line of instant stew mixes. We had no issues with the unit until the beginning of this month, when we began to notice an increase in processing time. We have followed the recommended cleaning schedule, so this problem cannot be caused by excess residue.</p><p>Please let me know if you have any suggestions for resolving this issue in a timely I manner. I always prefer to handle minor repairs on my own, but if this issue persists, we may need to schedule a maintenance visit in the near future.</p><p>Best regards,</p><p>Olivia Volterra</p><p>Yambrett Corporation</p><p><br/></p></div>',
