    detail:
      '<div><div><b>Spotlight on Carl Ybor</b></div><div>GORE, New Zealand (2 May)-Architect Carl Ybor has created a name for himself by helping clients turn their trash into treasure. He has built dozens of houses in Gore composed almost entirely of reclaimed, recovered, or found materials.</div><div>"As much as possible, I like to use materials that are already available nearby," says Mr. Ybor. "It just takes some creativity, but that way nothing is wasted and houses can be built for a fraction of the price. Old fencing, discarded bottles, corks, mismatched bricks and tiles--nothing gets overlooked."</div><div>While Mr. Ybor is fully responsible for creating the design plans for the houses he builds, he always involves homeowners in the building process. With a waiting list of at least a year, Mr. Ybor is able to carefully select his clients. He works solely with homeowners who already know how to operate power tools and are willing to do some of the hands on work themselves.</div><div>Some of his houses have been featured in magazines, travel shows, and online carpentry demonstrations. Mr. Ybor\'s Web site, featuring photos of his projects, can be found at yborhabitats.co.nz.</div><div><br/></div> <hr/><p><b>To:</b> <a class="__cf_email__" data-cfemail="086b67667c696b7c48716a677a60696a617c697c7b266b67266672" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>From:</b> <a class="__cf_email__" data-cfemail="11723f797e7d7c746251797c70787d3f7f7465" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>Date: </b>4 May</p><p><b>Subject:</b> Proposal</p><p>Dear Mr. Ybor,</p><p>I just read an article about you. I was excited to learn about your services and how you work with the owners to create unique spaces. I have two projects I want to work on:</p><p>1. I want to add an extension to my current house, incorporating leftover materials I have from the patio that I had built a few years ago.</p><p>2. My roof needs to be replaced. I have researched ways to cut the cost, and one suggestion was to leave the existing roof intact and just install new metal sheeting on top. like this idea!</p><p>Are you available and interested in doing this work? I would like to start as early as next month. I can pay half the money up front by credit card to secure an appointment.</p><p>Cynthia Holmes</p><p><br/></p></div>',
