      '<div><p><b>Tiêu điểm Carl Ybor</b></p><p>GORE, New Zealand (2 tháng 5) - Kiến trúc sư Carl Ybor đã tạo dựng tên tuổi cho chính mình bằng cách giúp khách hàng biến thùng rác của họ thành kho báu. Ông đã xây dựng hàng chục ngôi nhà ở Gore gần như hoàn toàn bằng vật liệu khai hoang, phục hồi hoặc tìm thấy.</p><p>Ông Ybor nói: “Càng nhiều càng tốt, tôi thích sử dụng những vật liệu đã có sẵn gần đó. "Nó chỉ cần một chút sáng tạo, nhưng theo cách đó không có gì là lãng phí và có thể xây dựng những ngôi nhà với giá chỉ bằng một phần nhỏ. Hàng rào cũ, chai lọ bỏ đi, nút chai, gạch và ngói không khớp - không có gì bị bỏ qua."</p><p>Trong khi ông Ybor chịu trách nhiệm hoàn toàn trong việc lập các phương án thiết kế cho những ngôi nhà mà ông xây dựng, ông luôn luôn cân nhắc các chủ nhà trong quá trình xây dựng. Với danh sách chờ ít nhất một năm, ông Ybor có thể lựa chọn cẩn thận các khách hàng của mình. Ông ấy chỉ làm việc với những chủ nhà đã biết cách vận hành các dụng cụ điện và sẵn sàng tự làm một số công việc.</p><p>Một số ngôi nhà của ông đã được giới thiệu trên các tạp chí, chương trình du lịch và các cuộc trình diễn nghề mộc trực tuyến. Trang web của ông Ybor, có các bức ảnh về các dự án của ông, có thể được tìm thấy tại yborhabitats.co.nz.</p><hr/><div><b>Tới:</b> <a class="__cf_email__" data-cfemail="debdb1b0aabfbdaa9ea7bcb1acb6bfbcb7aabfaaadf0bdb1f0b0a4" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div><b>Từ: </b><a class="__cf_email__" data-cfemail="93f0bdfbfcfffef6e0d3fbfef2faffbdfdf6e7" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div><b>Ngày:</b> 4 tháng 5</div><div><b>Chủ đề:</b> Đề xuất</div><div>Ông Ybor thân mến,</div><div>Tôi vừa đọc một bài báo về bạn. Tôi rất vui khi tìm hiểu về các dịch vụ của bạn và cách bạn làm việc với chủ sở hữu để tạo ra những không gian độc đáo. Tôi có hai dự án muốn thực hiện:</div><div>1. Tôi muốn thêm phần mở rộng cho ngôi nhà hiện tại của mình, kết hợp các vật liệu còn sót lại mà tôi có từ sân mà tôi đã xây cách đây vài năm.</div><div>2. Mái nhà của tôi cần được thay thế. Tôi đã nghiên cứu các cách để cắt giảm chi phí, và một gợi ý là để nguyên phần mái hiện có và chỉ lắp tấm kim loại mới lên trên. thích ý tưởng này!</div><div>Bạn có sẵn sàng và muốn làm công việc này không? Tôi muốn bắt đầu sớm nhất là vào tháng tới. Tôi có thể trả trước một nửa số tiền bằng thẻ tín dụng để đảm bảo một cuộc hẹn.</div><div>Cynthia Holmes</div></div>',
