    detail:
      '<div><div><b>To:</b> All CFA Staff</div><div><b>From:</b> Yung-Chien Chou</div><div><b>Date:</b> 16 October</div><div><b>Subject:</b> Plans</div><div><b>Attachment: </b>Agenda</div><div>Dear Colleagues,</div><div>Hagit Caspi will be visiting for a couple of days next week to interview for the position of executive vice president here at Cliff Firing Associates (CFA). She is highly qualified, and her background in international finance makes her particularly well suited for this role. Please make every effort to welcome her.</div><div>It is important to the CFA leadership that everyone has the opportunity to get to know Ms. Caspi. As such, am asking all of you to attend certain events with her. Please see the attached agenda, and add the events marked CFA to your calendar. More details will follow.</div><div>Best,</div><div>Yung-Chien Chou</div><div>CEO, Cliff Firing Associates</div><table class="table table-bordered"><tbody><tr><td><p><b>Agenda for Hagit Caspi\'s Visit</b></p><table class="table table-bordered"><tbody><tr><td><b>Date</b></td><td><b>Time</b></td><td><b>Event</b></td><td><b>Invitees</b></td></tr><tr><td>23 October</td><td>9:00 A.M.</td><td>Breakfast at La Brunch</td><td>Board Members</td></tr><tr><td>23 October<br/></td><td>12:30 P.M.</td><td>Lunch in office</td><td>Department heads</td></tr><tr><td>23 October<br/></td><td>3:00 P.M.</td><td>Question and answer section</td><td>CFA</td></tr><tr><td>23 October<br/></td><td>7:00 P.M.</td><td>Dinner at Medium Hills Bistro</td><td>Board Members<br/></td></tr><tr><td>24 October<br/></td><td>9:00 A.M.</td><td>Breakfast in office</td><td>CFA</td></tr></tbody></table><p><br/></p></td></tr></tbody></table><div><br/></div> <hr/><p><b>To:</b> Yung-Chien Chou &lt;<a class="__cf_email__" data-cfemail="76151e190336151a1f101010131f041f1811581517" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</p><p><b>From: </b>Hagit Caspi &lt;<a class="__cf_email__" data-cfemail="1c747d7b7568327f7d6f6c755c6a737069717970327f73327570" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</p><p><b>Date:</b> 27 October</p><p><b>Subject:</b> Follow-up</p><p>Dear Mr. Chou,</p><p>Many thanks for hosting me last week. I truly enjoyed meeting everyone. I particularly appreciated my conversation with Mr. Georgopoulos at Medium Hills Bistro. He told me some amazing stories about CFA\'s history.</p><p>Again, am sorry for not attending the event on the 24th. The weather was worrying, and did not want to miss my flight to Tel Aviv.</p><p>Last but certainly not least, thank you for your offer, which I received this morning. I would be honoured to take on the role of executive vice president of CFA starting in January. The job description covers everything we discussed. The hours you noted for the position seem appropriate, and I am very pleased with the benefits. I look forward to working closely with you.</p><p>Most sincerely,</p><p>Hagit Caspi</p><p><br/></p><p><br/></p></div>',
    transcript:
      '<div><p><b>Tới:</b> Tất cả nhân viên CFA</p><p><b>Từ:</b> Yung-Chien Chou</p><p><b>Ngày:</b> 16 tháng 10</p><p><b>Chủ đề: </b>Kế hoạch</p><p><b>Tệp đính kèm:</b> Chương trình làm việc</p><p>Các đồng nghiệp thân mến,</p><p>Hagit Caspi sẽ đến một vài ngày vào tuần tới để phỏng vấn cho vị trí phó chủ tịch điều hành tại Cliff Firing Associates (CFA) tại đây. Cô ấy có trình độ chuyên môn cao, và nền tảng của cô ấy về tài chính quốc tế khiến cô ấy đặc biệt phù hợp với vai trò này. Hãy làm mọi cách để chào đón cô ấy.</p><p>Điều quan trọng đối với ban lãnh đạo CFA là mọi người đều có cơ hội làm quen với cô Caspi. Vì vậy, tôi yêu cầu tất cả các bạn tham dự một số sự kiện nhất định với cô ấy. Vui lòng xem chương trình làm việc đính kèm và thêm các sự kiện được đánh dấu CFA vào lịch của bạn. Thông tin chi tiết sẽ có sau.</p><p>Chúc những gì tốt nhất,</p><p>Yung-Chien Chou</p><p>CEO, Cliff Firing Associates</p><table class="table table-bordered"><tbody><tr><td><p><b>Lịch trình chuyến thăm của Hagit Caspi</b></p><table class="table table-bordered"><tbody><tr><td><b>Ngày</b></td><td><b>Giờ</b></td><td><b>Sự kiện</b></td><td><b>Người được mời</b></td></tr><tr><td>23 Tháng 10</td><td>9:00 A.M.</td><td>Bữa sáng tại La Brunch</td><td>Hội đồng Quản trị</td></tr><tr><td>23 Tháng 10<br/></td><td>12:30 P.M.</td><td>Bữa trưa tại văn phòng</td><td>Các Trưởng phòng</td></tr><tr><td>23 Tháng 10<br/></td><td>3:00 P.M.</td><td>Phiên đặt câu hỏi và trả lời</td><td>CFA</td></tr><tr><td>23 Tháng 10<br/></td><td>7:00 P.M.</td><td>Bữa tối tại Medium Hills Bistro</td><td>Hội đồng Quản trị<br/></td></tr><tr><td>24 Tháng 10<br/></td><td>9:00 A.M.</td><td>Bữa sáng tại văn phòng<br/></td><td>CFA</td></tr></tbody></table><p><br/></p></td></tr></tbody></table><div><br/></div><hr/><div><b>Tới:</b> Yung-Chien Chou &lt;<a class="__cf_email__" data-cfemail="16757e796356757a7f707070737f647f7871387577" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</div><div><b>Từ: </b>Hagit Caspi &lt;<a class="__cf_email__" data-cfemail="c7afa6a0aeb3e9a4a6b4b7ae87b1a8abb2aaa2abe9a4a8e9aeab" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a>&gt;</div><div><b>Ngày: </b>27 tháng 10</div><div><b>Chủ đề:</b> Tiếp theo</div><div>Ông Chou thân mến,</div><div>Rất cám ơn vì đã sắp xếp cho tôi tuần trước. Tôi thực sự thích gặp gỡ tất cả mọi người. Tôi đặc biệt đánh giá cao cuộc trò chuyện của tôi với anh Georgopoulos tại Medium Hills Bistro. Anh ấy đã kể cho tôi nghe một số câu chuyện tuyệt vời về lịch sử của CFA.</div><div>Một lần nữa, xin lỗi vì đã không tham dự sự kiện vào ngày 24. Thời tiết thật đáng lo ngại, và tôi không muốn bỏ lỡ chuyến bay đến Tel Aviv.</div><div>Cuối cùng nhưng chắc chắn không kém phần quan trọng, cảm ơn bạn vì lời đề nghị của bạn, mà tôi đã nhận được sáng nay. Tôi sẽ vinh dự được đảm nhận vai trò phó chủ tịch điều hành của CFA bắt đầu từ tháng Một. Bản mô tả công việc bao gồm tất cả những gì chúng ta đã thảo luận. Thời gian bạn đã ấn định cho vị trí này có vẻ phù hợp, và tôi rất hài lòng với những quyền lợi. Tôi mong muốn được hợp tác chặt chẽ với bạn.</div><div>Chân thành,</div><div>Hagit Caspi</div></div>',
