    detail:
      '<div><div>TRIVESS (1 February) Alacritum, Inc., has announced plans to build charging stations for electric vehicles along Highway 1. With over 400 stations across Asia already, Alacritum brings a wealth of experience to this large scale undertaking. The Highway 1 stations, known as PRO stations, will provide vehicles with up to 200 kilowatts of power, achieving an 80 percent charge in 30 minutes. The system will periodically notify waiting drivers of the status of their battery charge by sending texts to their cell phones or other mobile devices. The company promises to provide motorists with clean, comfortable, brightly lit waiting facilities. A testing location will open at the beginning of next month in Logred.</div><div><br/></div> <hr/><p><b>PRO Station Proposed Distribution</b></p><table class="table table-bordered"><tbody><tr><td>Region</td><td>Number of Stations</td><td>Customers per Day</td></tr><tr><td>Elondell</td><td>26</td><td>9,220</td></tr><tr><td>Southern Borelvia</td><td>14</td><td>4,970</td></tr><tr><td>Western Borelvia</td><td>20</td><td>6,390</td></tr><tr><td>North Shore</td><td>10</td><td>3,560</td></tr></tbody></table><p><br/></p><hr/><p><b>To:</b> <a class="__cf_email__" data-cfemail="5811302b313937183934393b2a312c2d35763b3735" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>From: </b><a class="__cf_email__" data-cfemail="98fbeceaf1ffffd8f9f4f9fbeaf1ecedf5b6fbf7f5" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></p><p><b>Date: </b>15 March</p><p><b>Subject: </b>Meeting</p><p>Dear Mr. Hsiao,</p><p>Following the meeting with our community partners in Western Borelvia this week, suggest adding air-conditioning to the waiting areas in that region because of the desert conditions there. Although the addition entails higher costs, it will ensure the comfort and safety of the customers. I have also learned firsthand that poor cell service along Highway will make the wireless networks at most PRO stations unreliable, so we will need a technological solution for that as well. I will send a full report by the end of the week.</p><p>Chuck Trigg</p><div><br/></div><hr/></div>',
    transcript:
      '<div><p>TRIVESS (1 tháng Hai) Alacritum, Inc., đã công bố kế hoạch xây dựng các trạm sạc cho xe điện dọc theo Đại lộ 1. Với hơn 400 trạm đã có trên khắp Châu Á, Alacritum mang đến nhiều kinh nghiệm cho công việc quy mô lớn này. Các trạm trên Đại lộ 1, được gọi là trạm PRO, sẽ cung cấp cho các phương tiện công suất lên tới 200 kilowatt, đạt mức sạc 80% trong 30 phút. Hệ thống sẽ thông báo định kỳ cho các tài xế đang chờ về tình trạng sạc pin của họ bằng cách gửi tin nhắn tới điện thoại di động hoặc các thiết bị di động khác của họ. Công ty hứa hẹn sẽ cung cấp cho người lái xe khu vực chờ sạch sẽ, thoải mái, có ánh sáng rực rỡ. Một địa điểm thử nghiệm sẽ mở vào đầu tháng sau tại Logred.<br/></p><hr/><p><b>Phân bố Trạm PRO  được Đề xuất</b></p><table class="table table-bordered"><tbody><tr><td>Vùng</td><td>Số trạm</td><td>Lượng khách hàng hàng ngày</td></tr><tr><td>Elondell</td><td>26</td><td>9,220</td></tr><tr><td>Southern Borelvia</td><td>14</td><td>4,970</td></tr><tr><td>Western Borelvia</td><td>20</td><td>6,390</td></tr><tr><td>North Shore</td><td>10</td><td>3,560</td></tr></tbody></table><p><br/></p><hr/><div><b>Tới:</b> <a class="__cf_email__" data-cfemail="6f26071c060e002f0e030e0c1d061b1a02410c0002" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div><b>Từ: </b><a class="__cf_email__" data-cfemail="096a7d7b606e6e496865686a7b607d7c64276a6664" href="/cdn-cgi/l/email-protection">[email\xa0protected]</a></div><div><b>Ngày:</b> 15 tháng 3</div><div><b>Chủ đề:</b> Cuộc họp</div><div>Ông Hsiao thân mến,</div><div>Sau cuộc họp với các đối tác cộng đồng của chúng tôi ở Tây Borelvia trong tuần này, hãy đề nghị bổ sung điều hòa nhiệt độ cho các khu vực chờ ở khu vực đó vì điều kiện sa mạc ở đó. Mặc dù việc bổ sung này kéo theo chi phí cao hơn, nhưng nó sẽ đảm bảo sự thoải mái và an toàn cho khách hàng. Tôi cũng đã biết trước rằng dịch vụ di động kém dọc theo Đại lộ sẽ làm cho mạng không dây ở hầu hết các trạm PRO không đáng tin cậy, vì vậy chúng ta cũng sẽ cần một giải pháp công nghệ cho điều đó. Tôi sẽ gửi báo cáo đầy đủ vào cuối tuần.</div><div>Chuck Trigg</div><hr/></div>',
